import { useAppDispatch, useAppSelector } from "../redux/config/configStore";
import { decrement, increment, incrementByAmount } from "../redux/modules/templateSlice";

const Home = () => {
  const template = useAppSelector((state) => state.template)
  const dispatch = useAppDispatch();
  return <div>{template.value}<br />
    <button onClick={() => {
      dispatch(increment())
    }}>+클릭</button>
    <button onClick={() => {
      dispatch(decrement())
    }}>-클릭</button>
    <button onClick={() => {
      dispatch(incrementByAmount("0"))
    }}>payload클릭</button>
  </div>;
};

export default Home;
